import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import "./DogCafeDetail.css";
import Header from "../Header";
import Footer from "../Footer";
import ImageSlider from "../../ImageSlider";

interface Store {
  store_id: number;
  store_name: string;
  store_description: string;
  store_address: string;
  store_opening_hours: string;
  store_phone_number: string;
  store_url: string;
  store_img: string[];
  tags: string[];
  reviews?: Review[];
}

interface Review {
  id: number;
  store_id: number;
  rating: number;
  comment: string;
}

const getUserIdFromCookie = (): number | null => {
  const cookies = document.cookie.split("; ");
  for (let cookie of cookies) {
    const [name, value] = cookie.split("=");
    if (name === "userId") {
      const parsedValue = parseInt(value, 10);
      return isNaN(parsedValue) ? null : parsedValue;
    }
  }
  return null;
};

const DogCafeDetail: React.FC = () => {
  const { id } = useParams<{ id: string }>();
  const [store, setStore] = useState<Store | null>(null);
  const [error, setError] = useState<string | null>(null);
  const [isFavorite, setIsFavorite] = useState<boolean>(false);
  const [userId, setUserId] = useState<number | null>(null);

  const MAP_API_KEY = process.env.REACT_APP_MAP_API_KEY;

  useEffect(() => {
    setUserId(getUserIdFromCookie());
  }, []);

  useEffect(() => {
    if (!id) {
      setError("店舗IDが無効です");
      return;
    }

    const fetchStoreWithReviews = async () => {
      try {
        const storeResponse = await fetch(`http://localhost:5003/stores/detail/${id}`);
        if (!storeResponse.ok) throw new Error("店舗情報の取得に失敗しました");

        const storeData: Store = await storeResponse.json();
        console.log("取得したデータ:", storeData);

        const reviewResponse = await fetch(`http://localhost:5003/reviews`);
        if (!reviewResponse.ok) throw new Error("口コミデータの取得に失敗しました");

        const reviewData: Review[] = await reviewResponse.json();
        const reviews = reviewData.filter((review) => review.store_id === storeData.store_id);
        setStore({ ...storeData, reviews });
      } catch (err: any) {
        console.error("データ取得エラー:", err);
        setError("データの取得に失敗しました");
      }
    };

    fetchStoreWithReviews();
  }, [id]);

  if (error) return <div className="container">{error}</div>;
  if (!store) return <div className="container">データを読み込んでいます...</div>;

  return (
    <>
      <Header />
      <div className="container">
        <h1 className="detail-title">{store.store_name}</h1>
        <ImageSlider images={Array.isArray(store.store_img) ? store.store_img : [store.store_img]} />

        <button onClick={() => setIsFavorite(!isFavorite)} className={`favorite-button ${isFavorite ? "active" : ""}`}>
          {isFavorite ? "お気に入り解除" : "お気に入り登録"}
        </button>

        {store.reviews && store.reviews.length > 0 ? (
          <div>
            <p>評価: {(store.reviews.reduce((sum, rev) => sum + rev.rating, 0) / store.reviews.length).toFixed(1)}</p>
          </div>
        ) : (
          <p>口コミはありません</p>
        )}

        <p><strong>住所:</strong> {store.store_address}</p>

        {MAP_API_KEY ? (
          <iframe
            title="Google Map"
            src={`https://www.google.com/maps/embed/v1/place?key=${MAP_API_KEY}&q=${encodeURIComponent(store.store_address)}`}
          ></iframe>
        ) : (
          <p>Google Maps APIキーが設定されていません。</p>
        )}

        <p>電話番号: {store.store_phone_number}</p>
        <p>営業時間: {store.store_opening_hours}</p>

        <Link to={`/dogcafe/reviews/${store.store_id}`} className="review-button">口コミを見る</Link>

        <br />
        <a href={store.store_url} target="_blank" rel="noopener noreferrer" className="official-site">
          店舗の公式サイト
        </a>
      </div>
      <Footer />
    </>
  );
};

export default DogCafeDetail;
